+
+        case AC_SR_32K:
+            ac_config.sample_rate = AC_SR_32K;
+            break;
+
+        default:
+            kvs_log("Unsupported sample rate %d", sampleRate);
+            return -EINVAL;
+    }
+
+    switch (bitDepth) {
+        case AUD_BIT_16:
+            ac_config.bit_width = AC_BW_16;
+            break;
+
+        default:
+            kvs_log("Unsupported bit depth %d", bitDepth);
+            return -EINVAL;
+    }
+
+    ac_config.io_type = FH_AC_MIC_IN;
+    ac_config.period_size = 1024;
